//{{{  net primitives

function flipIndex (index) {
  const section = Math.floor(index / 64);
  const square = index % 64;
  const flippedSquare = square ^ 56;
  const flippedSection = (section + 6) % 12;
  const flippedIndex = flippedSection * 64 + flippedSquare;
  return flippedIndex;
}

